const Mode = ({mode}) => {
  return (
    <div
    className="mode-switch"
    onClick={() => setMode(mode === "dark" ? "light" : "dark")}
  >
    {mode === "dark" ? <i className="fa-solid fa-sun"></i> : <i classNmae="fa-solid fa-moon"></i>}
  </div>
  )
}

export default Mode
